import sys

def minPath(grid, k):
    n = len(grid)
    min_path = [sys.maxsize] * k

    def dfs(path, i, j):
        if len(path) == k:
            nonlocal min_path
            if path < min_path:
                min_path = path[:]
            return

        for x, y in ((i - 1, j), (i + 1, j), (i, j - 1), (i, j + 1)):
            if 0 <= x < n and 0 <= y < n:
                dfs(path + [grid[x][y]], x, y)

    for i, j in product(range(n), range(n)):
        dfs([grid[i][j]], i, j)

    return min_path

